import React, { useState, useEffect } from "react";
import axios from "axios";

function AddNewRating() {
    // State to hold the new ratings data
    const [addnewrating, setaddnewrating] = useState([]);

    // Fetch new ratings data from the API
    useEffect(() => {
      axios.get("http://localhost/COMP333_HW3/index.php/addnewrating")
        .then((response) => {
          setaddnewrating(response.data);
        })
        .catch((error) => {
          console.error("Error fetching new rating data:", error);
        });
    }, []);

    return (
      <div>
        <h1>Add a New Rating</h1>
        <ul>
          {addnewrating.map((addnewrating) => (
            <li key={addnewrating.id}>
              Artist: {addnewrating.artist}, Song: {addnewrating.song}, Rating - must be 1-5: {addnewrating.rating}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default AddNewRating;
